import logo from './logo.svg';
import './App.css';

function Test(props) {
  const name = props.name
  const age = props.age
  return (
    <p>{props.name}</p>
  );
}

function App() {
  return (
    <Test name="Ray" age="22"/>
  );
}

export default App;
